  spaceBetween: number;
  slidesPerView: number;
  navigation?: boolean;
  rewind?: boolean;
  pagination?: { dynamicBullets: boolean };
  onSwiper?: React.Dispatch<React.SetStateAction<SwiperClass | undefined>>;
